import React, { Component } from 'react';

class Main extends Component {
  render() {
    return (
      <div className="general">
        <h1>Laura Mann</h1>
        <p>Hello, I'm Laura and I'm a front-end developer.</p>
        <i class="fas fa-igloo"></i>
        </div>
    );
  }
}

export default Main;
